  name: 'Header',
  data: function(){
    return {
      isCalled: true,
      wanzheng: true,
      polie: false,
      liekai: false,
      luo: false,
      yi: false,
      x: false,
      play: false
    }
  },
  mounted () {
    this.$refs.luobirthday.play()
    setTimeout(() => {
      this.wanzheng = !this.wanzheng
      this.polie = !this.polie
    }, 1000);
    setTimeout(() => {
      this.polie = !this.polie
      this.liekai = !this.liekai
    }, 2000);
    setTimeout(() => {
      this.liekai = !this.liekai
      this.luo = !this.luo
    }, 3000);
    setTimeout(() => {
      this.yi = !this.yi
      this.luo = !this.luo
    }, 4000);
    setTimeout(() => {
      this.yi = !this.yi
      this.x = !this.x
    }, 5000);
    setTimeout(() => {
      this.play = !this.play
      this.x = !this.x
    }, 5000);
  },
  methods: {
    
  }
}
</script>
